import React, { useState } from 'react';
import { Container, Typography, List, ListItem, ListItemText, Divider } from '@mui/material';
import { useParams } from 'react-router-dom';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';

const PreDefinedPath = ({ pathways }) => {
  const { id } = useParams();

  // Find the selected pathway by id
  const selectedPathway = pathways.techPaths.find(pathway => pathway.id === id);

  if (!selectedPathway) {
    return <div>Pathway not found</div>;
  }

  return (
    <div>
      <h2>{selectedPathway.title} Pathway</h2>
      <ul className="steps">
        {selectedPathway.steps.map((step, index) => (
          <li key={index}>
            <p>{step}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};


export default PreDefinedPath;
